import React from "react"
import { Container } from 'reactstrap'
import { Redirect } from 'react-router-dom'

const UserActivity = props => {

    return (
      <>
        <Container>
          {props.user_id != props.match.params.id &&
            <Redirect to="/" />
          }
          <h2>Your Activity</h2>
        </Container>
      </>
    );
}

export default UserActivity
